  SCROLLBAR_SetDefaultColor(GUI_LIGHTBLUE, SCROLLBAR_CI_SHAFT);  
  SCROLLBAR_SetDefaultColor(GUI_LIGHTBLUE, SCROLLBAR_CI_ARROW);    
